import Task from './Task'

const Tasks = ({ tasks }) =>
{
  const deleteTask = (task) => {
    console.log(task)
  }

  return (
    <>
      {tasks.map((task) => (
        <Task task={task} deleteTask={deleteTask} />
       ))}     
    </>
  )
}

export default Tasks
